void Barrel(struct cl_entity_s* ent)
{
	if (g_Vars.Barrel) {
		vec3_t vecBegin, vecEnd, up, right, forward;
		VectorCopy(ent->origin, vecBegin);
		if (ent->curstate.usehull)
			vecBegin[2] += 12;
		else
			vecBegin[2] += 17;
		g_Engine.pfnAngleVectors(ent->angles, forward, right, up);
		forward[2] = -forward[2];
		vecBegin[0] += forward[0] * 10;
		vecBegin[1] += forward[1] * 10;
		vecBegin[2] += forward[2] * 10;
		vecEnd = vecBegin + forward * 999;
		if (g_LocalPlayer[ent->index].Team == 2)
			DrawLine(vecBegin, vecEnd, g_Vars.Player_TeammateBarrel[0], g_Vars.Player_TeammateBarrel[1], g_Vars.Player_TeammateBarrel[2], 0.001f);
		else if (g_LocalPlayer[ent->index].Team == 1)
			DrawLine(vecBegin, vecEnd, g_Vars.Player_EnemyBarrel[0], g_Vars.Player_EnemyBarrel[1], g_Vars.Player_EnemyBarrel[2], 0.001f);
	}
}

void TraceGrenade()
{
	QVector vecAngles, vecForward, vecStart, vecEnd, vecOut, plane_normal;
	pmtrace_t pmtrace;
	float flGravity = g_Engine.pfnGetGravity() / 3.75f;
	g_Engine.GetViewAngles(vecAngles);

	if (vecAngles[0] < 0)
		vecAngles[0] = -10 + vecAngles[0] * ((90 - 10) / 90.0);
	else
		vecAngles[0] = -10 + vecAngles[0] * ((90 + 10) / 90.0);

	float flVel = (90 - vecAngles[0]) * 4;

	if (flVel > 500)
		flVel = 500;

	g_Engine.pfnAngleVectors(vecAngles, vecForward, NULL, NULL);

	vecStart = g_Local.vEye + vecForward * 16;

	vecForward = (vecForward * flVel) + g_Local.ppmove->velocity;

	uint iCollisions = 0;
	float flTimeAlive;
	float flStep = (3.00f / 50.0f);
	for (flTimeAlive = 0; flTimeAlive < 3.00f; flTimeAlive += flStep)
	{
		vecEnd = vecStart + vecForward * flStep;

		g_Engine.pEventAPI->EV_SetTraceHull(2);
		g_Engine.pEventAPI->EV_PlayerTrace(vecStart, vecEnd, PM_STUDIO_BOX, -1, &pmtrace);
		if (pmtrace.ent != g_Local.ent->index && pmtrace.fraction < 1.0) //hits a wall
		{
			//hitpoint
			vecEnd = vecStart + vecForward * pmtrace.fraction * flStep;

			if (pmtrace.plane.normal[2] > 0.9 && vecForward[2] <= 0 && vecForward[2] >= (-1 * flGravity * 0.20f))
			{
				vecOut = vecEnd;
				return;
			}
			plane_normal = pmtrace.plane.normal;
			float flProj = vecForward.Dot(plane_normal);

			vecForward = (vecForward * 1.75f - flProj * 2 * pmtrace.plane.normal) * 0.75f; //reflection off the wall

			iCollisions++;

			if (iCollisions > 30)
				break;

			flTimeAlive -= (flStep * (1 - pmtrace.fraction));
		}
		float fScreenStart[2];
		float fScreenEnd[2];
		ImColor Col(g_Vars.color_red, g_Vars.color_green, g_Vars.color_blue, 1.f);
		if (WorldToScreen(vecStart, fScreenStart) && WorldToScreen(vecEnd, fScreenEnd))
		{
			ImGui::GetCurrentWindow()->DrawList->AddLine({ fScreenStart[0], fScreenStart[1] }, { fScreenEnd[0],fScreenEnd[1] }, Col);
		}
		float fScreen[2];
		if (WorldToScreen(vecEnd, fScreen))
			ImGui::GetCurrentWindow()->DrawList->AddRectFilled({ fScreen[0] - 1, fScreen[1] - 1 }, { fScreen[0] + 2, fScreen[1] + 2 }, Col);
		vecStart = vecEnd;

		vecForward[2] -= flGravity * pmtrace.fraction * flStep; //gravity
	}
	vecOut = vecStart;
}

void PlayerGlow(struct cl_entity_s* ent)
{
	if (ent->player)
	{
		color24 color;
		if (g_LocalPlayer[ent->index].Team == g_Local.Team)
		{
			color.r = g_Vars.Player_TeammateGlow[0] * 255;
			color.g = g_Vars.Player_TeammateGlow[1] * 255;
			color.b = g_Vars.Player_TeammateGlow[2] * 255;
			ent->curstate.renderamt = 1;
			ent->curstate.renderfx |= kRenderFxGlowShell;
			ent->curstate.rendercolor = color;
		}
		else
		{
			color.r = g_Vars.Player_EnemyGlow[0] * 255;
			color.g = g_Vars.Player_EnemyGlow[1] * 255;
			color.b = g_Vars.Player_EnemyGlow[2] * 255;
			ent->curstate.renderamt = 1;
			ent->curstate.renderfx |= kRenderFxGlowShell;
			ent->curstate.rendercolor = color;
		}
	}
}

