void Studio_PlayerColor()
{
	cl_entity_s* ent = IEngineStudioAPI.GetCurrentEntity();
	if (strstr(ent->model->name, XorString("costume")))
		return;

	for (int i = 1; i < 33; i++)
	{
		cl_entity_s* ent = g_Engine.GetEntityByIndex(i);
		cl_entity_s* localEnt = g_Engine.GetViewModel();

		if (ent->player)
		{
			ent->curstate.renderfx = 22;
			ent->curstate.rendermode = 4;
			if (g_LocalPlayer[i].Team == g_Local.Team)
			{
				PlayerColorSet.r = ColorDarkening(g_Vars.Player_TeammateColor[0] * 255, 75);
				PlayerColorSet.g = ColorDarkening(g_Vars.Player_TeammateColor[1] * 255, 75);
				PlayerColorSet.b = ColorDarkening(g_Vars.Player_TeammateColor[2] * 255, 75);
				ent->curstate.rendercolor.r = PlayerColorSet.r;
				ent->curstate.rendercolor.g = PlayerColorSet.g;
				ent->curstate.rendercolor.b = PlayerColorSet.b;
				ent->curstate.renderamt = 255;
			}
			else
			{
				PlayerColorSet.r = ColorDarkening(g_Vars.Player_EnemyColor[0] * 255, 75);
				PlayerColorSet.g = ColorDarkening(g_Vars.Player_EnemyColor[1] * 255, 75);
				PlayerColorSet.b = ColorDarkening(g_Vars.Player_EnemyColor[2] * 255, 75);
				ent->curstate.rendercolor.r = PlayerColorSet.r;
				ent->curstate.rendercolor.g = PlayerColorSet.g;
				ent->curstate.rendercolor.b = PlayerColorSet.b;
				ent->curstate.renderamt = 255;
			}
		}
		if (ent->index == g_Local.ent->index)
			ent->curstate.renderamt = 255;
		cl_entity_s* ent2 = IEngineStudioAPI.GetCurrentEntity();

		if (!ent2->player) ent2->curstate.rendermode = 0;
	}
}


int ColorDarkening(int col, int x)
{
	int color = col - x;
	if (color < 0) color = 0;
	return color;
}

void DrawBox(int x, int y, int r, int g, int b, int alpha, int radius, int thickness)
{
	int radius2 = radius << 1;
	g_Engine.pfnFillRGBA(x - radius + thickness, y - radius, radius2 - 2, thickness, r, g, b, alpha);
	g_Engine.pfnFillRGBA(x - radius, y - radius, thickness, radius2, r, g, b, alpha);
	g_Engine.pfnFillRGBA(x - radius, y + radius, radius2, thickness, r, g, b, alpha);
	g_Engine.pfnFillRGBA(x + radius, y - radius, thickness, radius2 + thickness, r, g, b, alpha);
}

