void DrawHudString(int x, int y, int r, int g, int b, const char* fmt, ...)
{
	va_list va_alist;
	char buf[256];
	va_start(va_alist, fmt);
	_vsnprintf(buf, sizeof(buf), fmt, va_alist);
	va_end(va_alist);
	g_Engine.pfnDrawSetTextColor(r / 255.0, g / 255.0, b / 255.0);
	g_Engine.pfnDrawConsoleString(x, y, buf);
}


void DrawHudString2(int x, int y, int r, int g, int b, const char* fmt, ...)
{
	va_list va_alist;
	char buf[256];

	va_start(va_alist, fmt);
	_vsnprintf(buf, sizeof(buf), fmt, va_alist);
	va_end(va_alist);

	int borderY = g_Vars.displayCenterY * 2 - 18;
	if (y<0 || y>borderY) { return; }
		
	bool needSingleCheck = false;
	int borderX = g_Vars.displayCenterX * 2 - 11;

	int drawLen = DrawLen(buf);
	if (x < 1) { needSingleCheck = true; }
	else
	{
		int maxX = x + drawLen;
		needSingleCheck = (maxX > borderX);
	}

	if (needSingleCheck)
	{
		for (char* p = buf; *p; p++)
		{
			int next = x + screeninfo.charWidths[*p];
			if (x > 0 && x < borderX)
				g_Engine.pfnDrawCharacter(x, y, *p, r, g, b);
			x = next;
		}
	}
	else {
		for (char* p = buf; *p; p++)
		{
			int next = x + screeninfo.charWidths[*p];
			g_Engine.pfnDrawCharacter(x, y, *p, r, g, b);
			x = next;
		}
	}
}

char* gGetWeaponName(int weaponmodel)
{
	static char weapon[50];
	weapon[0] = 0;

	model_s* mdl = IEngineStudio->GetModelByIndex(weaponmodel);
	if (!mdl) { return weapon; }

	char* name = mdl->name;  if (!name) { return weapon; }
	int len = strlen(name);  if (len > 48 || len < 10) { return weapon; }

	strcpy(weapon, name + 9); len -= 9;
	if (len > 4)weapon[len - 4] = (char)0;

	return weapon;
}

void DrawTrace(cl_entity_s* pEnt, int r, int g, int b, float life, float width)
{
	if (pEnt)
	{
		int beamindex = 0;
		if (!beamindex)
			beamindex = g_Engine.pEventAPI->EV_FindModelIndex(XorString("sprites/laserbeam.spr"));
		g_Engine.pEfxAPI->R_BeamFollow(pEnt->index, beamindex, life, width, r / 255, g / 255, b / 255, 255);
	}
}

void DrawImage(int x, int y, int w, int h, char* Image)
{
	g_Engine.pTriAPI->RenderMode(kRenderTransAlpha);

	g_Engine.pTriAPI->SpriteTexture((model_s*)g_Engine.GetSpritePointer(g_Engine.pfnSPR_Load(Image)), 4);
	g_Engine.pTriAPI->Color4f(1.0f, 1.0f, 1.0f, 1.0f);
	g_Engine.pTriAPI->CullFace(TRI_NONE);
	g_Engine.pTriAPI->Begin(TRI_QUADS);
	g_Engine.pTriAPI->TexCoord2f(0.0f, 1.0f);
	g_Engine.pTriAPI->Vertex3f(x - w, y, 0);
	g_Engine.pTriAPI->TexCoord2f(0.0f, 0.0f);
	g_Engine.pTriAPI->Vertex3f(x - w, y + h, 0);
	g_Engine.pTriAPI->TexCoord2f(1.0f, 0.0f);
	g_Engine.pTriAPI->Vertex3f(x + w, y + h, 0);
	g_Engine.pTriAPI->TexCoord2f(1.0f, 1.0f);
	g_Engine.pTriAPI->Vertex3f(x + w, y, 0);
	g_Engine.pTriAPI->End();
	g_Engine.pTriAPI->RenderMode(kRenderNormal);
}

int DrawLen(char* fmt)
{
	int len = 0;
	for (char* p = fmt; *p; p++) len += screeninfo.charWidths[*p];
	return len;
}

bool IsCanDraw(int i, float selection)
{
	if (selection == 0.0)
	{
		if (g_Local.Team != g_LocalPlayer[i].Team)
		{
			return true;
		}
	}
	else if (selection == 1.0)
	{
		if (g_Local.Team == g_LocalPlayer[i].Team)
		{
			return true;
		}
	}
	else if (selection == 2.0)
	{
		return true;
	}
	return false;
}
